        [
            {
                id : 1 ,
                day : 'sunday' ,
                img : 'https://ssl.gstatic.com/onebox/weather/48/partly_cloudy.png'
            }
        ]
    );
  return (
    <div>
      {weather[0].img}
    </div>
  );
}

export default SecondComponent;
